VALUES ('3258561412696', 'Fil.cabillaud Pane 8T. 400g', 'filets de cabillaud (Gadus -Morhua ou Gadus Macrocephalus) (70%), chapelure (contient : blé), eau, farine de amidon modifié de blé, sel. Traces possibles de moutarde. Bien qu\'un soin tout particulier ait été pris pour enlever toutes les arêtes, quelques unes peuvent exceptionnellement se trouver dans ce produit. Conseils de préparation : sans décongelation préalable. A la poêle : déposez les tranches panées dans une poêle après y avoir fait chauffer du beurre ou de l\'huile. Faites cuire chaque face 4 à 5 minutes. A la friteuse : plongez les tranches panées dans l\'huile préalablement chauffée à 175°C. Faites cuire environ 5 à 6 minutes. Egouttez et servez bien chaud. Conservation : * 24 heures dans un réfrigérateur * * 3 jours dans le compartiment à glace d\'un réfrigérateur, Plusieurs mois dans un congélateur (-18 °C) jusqu\'à la date indiquée sur ce paquet. ATTENTION : NE JAMAIS RECONGELER UN PRODUIT DÉCONGELÉ A consommer de préférence avant fin : voir sur le côté.', '0.52', '0.26', '14.6', '1.4', '', '14', '0.46', '0.181102362204724', '', '1');

